import styled from 'styled-components'
import { Link } from 'react-router-dom'
import { IoMdArrowBack } from 'react-icons/io'

const StyledHeader = styled.header`
    display: flex;
    align-items: center;
    border-style: solid;
    margin-top: 1em;
`;

const Menuicon = styled.i`
    width: 1em;
    height: 1em;
    position: relative;
    font-size: 3em;
    margin: 0.2em;
    margin-left: 0.4em;
    padding: 0;
    background-color: #b3b3b3;

    a:visited{
        color: #575757;
    }
`;

const Title = styled.h2`
    margin-left: 0;
`;

const Header = () => {
    return (
        <StyledHeader>
            <Menuicon><Link to='/menu'><IoMdArrowBack /></Link></Menuicon>
            <Title>WMS Management</Title>
            <h3 style={{marginLeft: 'auto', marginRight: '1em'}}>USER</h3>
        </StyledHeader>
    )
}

export default Header
